class TransactionsComponent {
    constructor(router, userService) {
        this.router = router;
        this.userService = userService;
        this.displayedColumns = ['Date', 'Description', 'Currency', 'Value', 'Balance'];
    }
    ngOnInit() {
        this.user$ = this.userService.user$;
        this.user$.subscribe((resp) => {
            this.account = resp.accounts.find(element => element.transactions.length !== 0);
            if (!this.account)
                return this.router.navigate(['/dashboard/accountSummary']);
            this.account.transactions.sort((a, b) => new Date(b.date).getTime() - new Date(a.date).getTime());
        });
    }
    getTotalToDate(currentDate) {
        return this.account.transactions.reduce(function (prev, transaction) {
            if (new Date(transaction.date) <= new Date(currentDate)) {
                return prev + transaction.value;
            }
            return prev;
        }, 0);
    }
}


